import React from "react";
import Slider from "react-slick";

import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Slides = () => {
	let settings = {
		dots: true,
		infinite: true,
		speed: 500,
		slidesToShow: 1,
		slidesToScroll: 1,
	};
	return (
		<div className="container-fluid px-0 mx-0 slides">
			<Slider {...settings}>
				<div>
					<img src="/images/lmj001.jpg" alt="Lamiju Alao-Akala" />
				</div>
				<div>
					<img src="/images/lmj-addressing-people.jpg" alt="Lamiju Alao-Akala" />
				</div>
				<div>
					<img src="/images/lmj01.jpg" alt="Lamiju Alao-Akala" />
				</div>
			</Slider>
		</div>
	);
};

export default Slides;
